import React from 'react';
import "./All.css";
import Gallerynav from './gallerynav';
import Painting from './Painting';
import Sculpture from './Sculpture';
import {onepaint,twopaint, threepaint, fourpaint} from './Painting';
import {onesculp,twosculp, threesculp, foursculp} from './Sculpture';

const All = () =>{
    
    return (
        <div>
            <Gallerynav />
            {/*<button type="button" class="btn" onclick = {()=>{}}>⚙</button>*/}
        <div class="grid-container">
        <span className="btn1" onclick = {()=>{}}>⚙</span>
        <span className="btn2" onclick = {()=>{}}>⚙</span>
        <span className="btn3" onclick = {()=>{}}>⚙</span>
        <div class="grid-item">
             {onepaint} 
        
         
         </div>
        <div class="grid-item">{twopaint}
        </div>
        <div class="grid-item">{threepaint}
        </div>
        <div class="grid-item">{fourpaint}
        <span className="btn4" onclick = {()=>{}}>⚙</span></div>
        <div class="grid-item">{onesculp}
        <span className="btn5" onclick = {()=>{}}>⚙</span></div>
        <div class="grid-item">{twosculp}
        <span className="btn6" onclick = {()=>{}}>⚙</span></div>
        <div class="grid-item">{threesculp}
        <span className="btn7" onclick = {()=>{}}>⚙</span></div>
        <div class="grid-item">{foursculp}
        <span className="btn8" onclick = {()=>{}}>⚙</span></div>
        </div>
        </div>

        
        
        
    );
    
}


export default All;
